import Header from "./components/Header";
import Home from "./pages/Home";
import { createTheme } from "@mui/material/styles";

const theme = createTheme({
  palette: {
    primary: {
      main: "#555",
    },
  },
});

function App() {
  return (
    <>
      <Header />
      <Home />
    </>
  );
}

export default App;
